DROP TABLE IF EXISTS CountyPrEP;
CREATE TABLE CountyPrEP(
    GEOID INTEGER, 
	COUNTY VARCHAR(50), 
	STATE VARCHAR(2), 
	YEAR INTEGER, 
	CountyPrEPUsers INTEGER, 
	CountyPrEPRate INTEGER,
	PRIMARY KEY(GEOID, YEAR)
);

Select GEOID, COUNTY, StateAbbreviation, YEAR, CountyPrEPUsers, CountyPrEPRate FROM countyprepall 
WHERE StateAbbreviation = 'NJ';



DROP TABLE IF EXISTS IncomeData;	
CREATE TABLE IncomeData(	
    GEOID INTEGER, 	
    County VARCHAR(50), 	
    Year INTEGER, 	
    PovertyPct DOUBLE, 	
    MedianIncome INTEGER, 	
    UnemploymentRate DOUBLE, 	
    PRIMARY KEY(GEOID, Year)	
);	

SELECT GEOID, County, Year, PovertyPercentage, MedianHouseholdIncome, UnemploymentRate FROM complete;



DROP TABLE IF EXISTS HIVNJ;
CREATE TABLE HIVNJ (
    County VARCHAR(50),
    Year INTEGER,
    HIVCount INTEGER,
	GEOID INTEGER,
	PRIMARY KEY(GEOID, YEAR)
);



DROP TABLE IF EXISTS CountyPop;																														
CREATE TABLE CountyPop(																														
    Year INTEGER, 																														
    County VARCHAR(50), 																														
    Population INTEGER, 																														
    GEOID INTEGER, STATE VARCHAR(2),																														
    Primary Key(GEOID, Year)																														
);																														




DROP TABLE IF EXISTS DataWarehouse;
CREATE TABLE DataWarehouse(
    GEOID INTEGER, 
	County VARCHAR(50), 
	State VARCHAR(2), 
	Year INTEGER, 
	CountyPrEPUsers INTEGER, 
	CountyPrEPRate INTEGER, 
	Population INTEGER,
	HIVCount INTEGER,
	PovertyPct DOUBLE, 
	MedianIncome INTEGER, 
	UnemploymentRate DOUBLE,
	PRIMARY KEY(GEOID, YEAR)
); 


Select CountyPop.GEOID, CountyPop.County, CountyPop.State, CountyPop.Year, CountyPrEPUsers, CountyPrEPRate, Population, HIVCount, PovertyPct, MedianIncome, UnemploymentRate
FROM CountyPop LEFT JOIN CountyPrEP On CountyPop.GEOID = CountyPrEP.GEOID AND CountyPop.Year = CountyPrEP.YEAR
LEFT JOIN HIVNJ on CountyPop.GEOID = HIVNJ.GEOID AND CountyPop.Year = HIVNJ.Year
Left Join IncomeData on CountyPop.GEOID = IncomeData.GeoID and CountyPop.Year = IncomeData.Year;

--HIVrate
Drop table if exists HIVRate;
Create Table HIVRate as 
select county, year, sum(HIVCount*1.0/Population) as HIVrate from DataWarehouse where year > 2007
group by county, year
order by HIVrate desc;


--MedianIncome TABLE
Drop table if exists MedianIncomePT;
Create Table MedianIncomePT as 
select county,year, MedianIncome as MedianIncome from datawarehouse where year > 2005 and MedianIncome<> 'Null'
group by county, year
order by MedianIncome ASC
limit 20;

--PrEPtoNeedRatio
Drop table if exists PnR;
Create Table PnR as 
select county, year,(1.0*CountyPrEPUsers/HIVCount) as PrEPtoNeed from DataWarehouse where year >2011 AND PrEPtoNEED <> 'NULL'
group by county, year
order by PrEPtoNeed asc
limit 10;

--PovertyPct
Drop table if exists PovertyPercent;
Create Table PovertyPercent as 
select county, year, PovertyPct from DataWarehouse where year > 1996
group by county, Year
order by PovertyPct desc;

--UnemploymentRate
Drop table if exists UnemploymentRate;
Create Table UnemploymentRate as 
select county, year, UnemploymentRate from DataWarehouse
group by county, Year
order by UnemploymentRate desc;

--PrEPrate
Drop table if exists PrEPRate;
Create Table PrEPRate as 
select county, year, CountyPrEPRate from DataWarehouse where year > 2011 and CountyPrEPRate <> 'NULL'
group by county, Year
order by CountyPrEPRate asc;